import React from 'react';
import './Header2.css'; // Подключаем стили модуля

const HeaderPart2 = () => {
  return (
    <div className="header-part2-container">
      <div className="header-part2-content">
        <div className="logo-container">
          {/* Иконка */}
          {/* Текст "AVT-ZAP" */}
          <p className="subtext">Интернет-магазин запчастей для АКПП</p>
        </div>
        <div className="working-hours-container">
          {/* Иконка */}
          {/* Текст "Мы работаем: будни - 9:00-21:00" */}
          <div className="green-rectangle">
            {/* Иконка */}
            {/* Текст "Напишите нам в WhatsApp" */}
          </div>
          <p className="contact-info">+7 383 291 92 86</p>
          <p className="feedback-info">Форма обратной связи</p>
        </div>
      </div>
    </div>
  );
};

export default HeaderPart2;
